import React from "react";
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import UpdateForm from "./UpdateForm";

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/update_employee">Update Employee</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/update_employee">
            <UpdateForm />
          </Route>
          <Route path="/"></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
